import React, {Component} from 'react';
import axios from 'axios';

class Home extends Component {
    constructor(props) {
        super(props);
        this.state={
            login : false,
            dok : [],
            optionurl : ''
        }

    }
    componentDidMount() {
        axios({
            method: 'get',
            url: this.state.optionurl,
        }).then((response) => {
            this.setState({doks: response.data})
            console.log(response.data)

        }).catch((error) => {
            console.log(error)
        });
    }

    render() {
        if (this.props.login)
        return (
            <div className="data-in-page">
                Home
            </div>
        );
        else
            return (
                <div className="data-in-page"> <h2>Login error</h2></div>);
    }
}

export default Home;
